import { RouterProvider, createRoutesFromElements, Route, Routes, createBrowserRouter } from 'react-router-dom';
import HomePage from './pages/Home';
import ProductsPage from './pages/Products';
import RootLayout from './pages/Root';

const routesDefinition = createRoutesFromElements(
  <Routes>
    <Route path='/' element={<RootLayout />} />
    <Route><Route path= '' element= {<HomePage />}/>
    <Route path= '/products' element= {<ProductsPage />}/></Route>

  </Routes>
);

// const router = createBrowserRouter([
//   {path: '', element: <HomePage />},
//   {path: '/products', element: <ProductsPage />}
// ]);

const router = createBrowserRouter(routesDefinition)

function App() {
  return <RouterProvider router={router}/>;
}

export default App;
